import React, { Component } from "react";

class TaskTable extends Component {

  render() {
    const {tasks} = this.props;
    console.log(tasks);

    return (
      <div>
        {tasks.map((task, i) => {
          return (
            <tr>
            <td>{task}</td>
          </tr>
          )
        })}
      </div>
    )
  }
}

export default TaskTable;
